  false,\n\t\"url\": null,\n\t\"notes\": \"This data is created by the Cowen Institute
  using data on school performance from the Louisiana Department of Education. It
  includes the percent of schools in New Orleans by letter grade annually beginning
  in 2009. Note: the schools included in the total universe of schools varies from
  year to year based on the schools that were open in New Orleans for that year. Also,
  beginning in the 2012-13 school year, the Louisiana Department of Education changed
  the scale by which schools were assessed. See p. 20 of the Cowen Instituteu2019s
  u201cState of Public Schools in New Orleans, 2014u201d (available here: http://www.speno2014.com/)
  for more information.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
